import React, { useState } from "react";

function Login() {
  cosnt[(user, setUser)] = useState({
    email: "",
    password: "",
  });
  return <div className="login-page">
          <from>
              <input type="email" name="email" required
              placeholder="Email" value={user.email} />
          </from>
  </div>;
}

export default Login;
